// Load up each line of the ratings data into an RDD
val lines = sc.textFile("/data/users.csv")

final case class User(     
      id: String, 
      name: String, 
      screen_name: String, 
      location: String, 
      url: String, 
      description: String, 
      verified: Option[Boolean],
      followers_count: Option[Int],
      friends_count: Option[Int],
      listed_count: Option[Int], 
      favourites_count: Option[Int], 
      statuses_count: Option[Int], 
      created_at: String, 
      utc_offset: Option[Int],
      time_zone: String, 
      geo_enabled: Option[Boolean],
      lang: String, 
      profile_image_url_https: String
)

def convertToInt(str : String) : Option [Int] = {
    try {
        return Some(str.toInt)
    } catch {
        case e:Exception => return None
    }
}

def convertToBool(str : String) : Option [Boolean] = {
    try {
        return Some(str.toBoolean)
    } catch {
        case e:Exception => return None
    }
}

def mapper(line: String) = {
    val fields = line.split(",")
    User(
        fields(0),
        fields(1),
        fields(2),
        fields(3),
        fields(4),
        fields(5),
        convertToBool(fields(6)),
        convertToInt(fields(7)),
        convertToInt(fields(8)),
        convertToInt(fields(9)),
        convertToInt(fields(10)),        
        convertToInt(fields(11)),
        fields(12),
        convertToInt(fields(13)),
        fields(14),
        convertToBool(fields(15)),
        fields(16),
        fields(17)
    )
}

val users = lines.map(mapper)

//users.collect.foreach(println)
users.count

import sqlContext.implicits._

val usersDF = users.toDF

usersDF.printSchema

usersDF.registerTempTable("users")

%pig

NewUsers = FOREACH Users GENERATE location;
DUMP NewUsers;

%pig

Vfd = FILTER Users BY verified == TRUE;
Gp = GROUP Vfd ALL;
Res = FOREACH Gp GENERATE COUNT(Vfd) as cn;
DUMP @;
